import Head from "next/head";
import Layout from "../components/Layout";

export default () => (
  <div>
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      <meta charSet="utf-8" />
    </Head>
    <style jsx global>{`
      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }
      body {
        background: #000;
        font: 11px menlo;
        color: #fff;
      }
    `}</style>
  </div>
);
